      // Non-standard
      "\\arcosh": "Arccosh",
      // Non-standard
      "\\arccosh": "Arccosh",
      "\\artanh": "Arctanh",
      "\\arctanh": "Arctanh",
      "\\arsech": "Arcsech",
      "\\arcsech": "Arcsech",
      "\\arcsch": "Arccsch",
      "\\arccsch": "Arccsch",
      "\\ch": "Cosh",
